import { StyleSheet, Text, View } from "react-native";
import React from "react";

const Login_Recruiter = () => {
  return (
    <View>
      <Text>Login_Recruiter</Text>
    </View>
  );
};

export default Login_Recruiter;

const styles = StyleSheet.create({});
